import React, { useState } from 'react'
import { useEffect } from 'react'

const ApiCall = () => {
    // console.log('Hello')
    const [Data, setData] = useState({})

    useEffect(() => {
        fetch("https://swapi.dev/api/people/1")
    .then(res => res.json())
    .then(data => setData(data));
    })


  return (
    <div>{JSON.stringify(Data, null, 2)}</div>
  )
}

export default ApiCall
